import {
    createBrowserRouter,
    RouterProvider,
} from "react-router-dom";
import Register from './pages/Register'
import Login from './pages/Login'
import Write from './pages/Write'
import Single from './pages/Single'
import Home from './pages/Home'
const router = createBrowserRouter([{
        path: "/",
        element: < div > I love Mona! < /div>,
    },
    {
        path: "/Register",
        element: < Register / > ,
    },
    {
        path: "/Login",
        element: < Login / > ,
    },
    {
        path: "/Write",
        element: < Write / > ,
    },
    {
        path: "/Single",
        element: < Single / > ,
    },
    {
        path: "/Home",
        element: < Home / > ,
    },

]);

function App() {
    return ( <
        div >
        <
        RouterProvider router = { router }
        />    </div >
    );
}

export default App;
